import React from 'react';
import { Switch, Route } from 'react-router-dom';

import LandingPage from './LandingPage';
import AboutMe from './components/About/About';
import Contact from './Contact/Contact';
import Projects from './Projects/Projects';
import Skills from './component/Skills/Skills';
import Resume from './components/Resume';



const Main = () => (
  <Switch>
    <Route exact path="/" component={LandingPage} />
    <Route path="/components/About/About" component={AboutMe} />
    <Route path="/components/Contact/Contact" component={Contact} />
    <Route path="/components/Projects/Projects" component={Projects} />
    <Route path="/components/Skills/Skills" component={Skills} />
    <Route path="/components/Resume" component={Resume} />
  </Switch>
)

export default Main;
